import styled from "styled-components";

export const SSection = styled.section`
  max-width: 1200px;
  padding: 40px;
  margin-top: 20px;
  background-color: #fff;
`;

export const SBox = styled.div`
  width: 50%;
  display: block;

  input {
    width: 400px;
  }
`
